import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    id: 0,
    castegoryId: 0,
    goodsId: 0,
    city: ''
  },
  getters: {},
  mutations: {
    savaID(state, id) {
      state.id = id
    },
    saveCategoryId(state, id) {
      state.castegoryId = id
    },
    saveGoodsId(state, id) {
      state.goodsId = id
    },
    saveCity(state, city) {
      state.city = city
    }
  },
  actions: {},
  modules: {}
})
